import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";
import './main.css'


function Main(props){
    let lgt=useNavigate();


function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token');
    lgt('/');

 }

    return(
        <div style={{backgroundColor:'white'}}>

<div class="w3-top">
  <div className="w3-bar w3-white w3-card" id="myNavbar">
    <a href="#home" className="w3-bar-item w3-button w3-wide">VOTE</a>
    <div class="w3-right w3-hide-small">
      <a onClick={props.h} class="w3-bar-item w3-button">{props.home}</a>
      <a href="#team" class="w3-bar-item w3-button"><i class={props.teamfont}></i> {props.team}</a>
      <a href="#work" class="w3-bar-item w3-button"><i class={props.workfont}></i> {props.work}</a>
      <a class="w3-bar-item w3-button"><i class={props.contactfont}></i>{props.contact} </a>
      <a  onClick={props.navi}  class="w3-bar-item w3-button"><i class={props.loginfont}></i> {props.login}</a>
    </div>

    <a href="javascript:void(0)" class="w3-bar-item w3-button w3-right w3-hide-large w3-hide-medium"  onClick={props.toggl}>
      <i class="fa fa-bars"></i>
    </a>
  </div>
</div>


<div class="w3-top" id="myNavbar">
<div class="w3-bar w3-black w3-opacity w3-hover-opacity-off w3-center w3-small">
  <a href="#" class="w3-bar-item w3-button" style={{width:"25%"}}>HOME</a>
  <a href="#about" class="w3-bar-item w3-button" style={{width:"25%"}}>ABOUT</a>
  <a href="#photos" class="w3-bar-item w3-button" style={{width:"25%"}}>PHOTOS</a>
  <a href="#logout" onClick={Logout} class="w3-bar-item w3-button" style={{width:"25%"}}>Logout</a>
</div>
</div>
        </div>
    );
}

export default Main;
